local tokens = {}

tokens.split = function(input, separator)
    if separator == nil then
        separator = "%s"
    end
    local t = {}
    for str in string.gmatch(input, "([^" .. separator .. "]+)") do
        table.insert(t, str)
    end
    return t
end

